import React, { Component } from 'react';
// import {Link} from 'react-router-dom';

class Header extends Component {


    constructor(props) {

        super();
         }
    render() {
        return (
            <div className="Header">
                <header className="navbar navbar-expand-sm navbar-dark bg-primary"  >
                    <a className="navbar-brand" href='/login'>Navbar</a>

                    <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                        <li className="nav-item active">
                            <a className="nav-link" href='/login'>Home <span className="sr-only">(current)</span></a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href='/login'>Welcome</a>
                        </li>
                    </ul>
                    <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                        <li className="nav-item active">
                            <a className="nav-link" href='/login'>Login <span className="sr-only">(current)</span></a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href='/login'>Logout</a>
                        </li>
                    </ul>
                </header>

            </div>
        );


    }
}

export default Header;
